// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/finance/PaymentSplitter.sol";

contract Payments is PaymentSplitter {

    address[] private contributors = [
        0x1BEb6235e160B4007b01E74483De4FBE4A10E233,
        0x44DAe7210064C7AED59FE174326fA8cf34eFcd0f,
        0x1773b544f3EA46CD1D4CC6aACa8e5de337e26889
    ];

    uint256[] private royalties = [
        46,
        46,
        14
    ];

    constructor () PaymentSplitter(contributors, royalties) payable {}
}
